CREATE TABLE Users(User_Id SERIAL NOT NULL PRIMARY KEY ,Email_Id varchar(50) Not NULL,Password varchar(1000) NOT NULL,First_Name varchar(250) Not NULL,Last_Name varchar(250) NOT NULL,Created_on timestamp without time zone NOT NULL,Created_by varchar not null, Updated_on timestamp without time zone NULL,Updated_by varchar null,Role varchar(20)NOT NULL,Teams Varchar Not NULL,Delete BIT null);
CREATE TABLE Asset(Asset_Id  SERIAL NOT NULL PRIMARY KEY,Asset_Name varchar (50) NOT NULL,Server_Serial varchar NULL,Server_Model varchar NULL,Manufacturer varchar  NULL, Owner varchar NULL,Category varchar NULL,Still_needed bool  null,Current_Project varchar null,Notes varchar null,Previous_Project varchar  null,BOM varchar  null,Support_case varchar null,Cluster_Id  Varchar  NULL,Asset_location varchar  NULL,Lab varchar null, Row int null, Rack int null,RU int  null,DC_status varchar null, Cpu_model varchar(50) NULL,Generation varchar NULL,CPU_Sockets varchar(50) NULL,PDU_IP inet null,PDU_User varchar null,PDU_Password varchar null,BMC_IP inet  NULL, BMC_User varchar  NULL, BMC_Password varchar  NULL, BMC_FQDN varchar NULL,Operating_System varchar null,OS_IP inet null,OS_User varchar  NULL,OS_Password varchar(1000) null,DIMM_Size varchar(50) null ,DIMM_Capacity varchar(50) NULL ,Storage_Vendor Varchar(50)  NULL,Storage_Controller Varchar(50) NULL,Storage_Capacity varchar(50) NULL,Network_Type BOOL  NULL,Network_speed varchar(50) NULL,Number_Of_Network_Ports varchar(50) NULL,Special_Switching_Needs Varchar(100) NULL,Required_Start_Date timestamp without time zone NOT NULL,Required_Finish_Date timestamp without time zone NOT NULL,Created_on timestamp without time zone NOT NULL,Created_by VARCHAR(50)  NULL,Assigned_to INT,FOREIGN KEY(Assigned_to) REFERENCES Users(User_Id) ,Assigned_from timestamp without time zone null,Assigned_by varchar(50)  null,Updated_on timestamp without time zone NULL,Updated_by varchar  NULL, Purpose varchar(300) NULL, Delete BIT NULL,Reserved BOOL NOT NULL,Asset_type varchar(50) NOT NULL,Power_Status BOOL NULL ,Memory_Id varchar(50) NULL,Rank_Count int NULL,MemoryDeviceType varchar(50) NULL,Memory_CapacityMiB int NULL,Memory_AllowedSpeedsMHz int NULL,Memory_OperatingSpeedMhz int NULL, Disk_Id Varchar(50) NULL,Media_Type varchar(50) NULL,Disk_Description varchar(100) NULL,Network_Id varchar(50) NULL,PCIeType varchar(50)NULL,Processor_Id varchar(50) NULL,Instruction_Set varchar(50) NULL,Processor_Model varchar(50) NULL,Processor_Architecture varchar(50) NULL,Total_Cores int NULL,Total_Threads int NULL,Socket varchar(50) NULL,CPU_Family varchar(50) NULL);
CREATE TABLE Historic_details(ID SERIAL NOT NULL  PRIMARY KEY,Asset_Id SERIAL NOT NULL ,Asset_Name varchar (50) NOT NULL,Created_on timestamp without time zone NOT NULL,Created_by VARCHAR(50)  NULL,BMC_IP inet  NULL,Assigned_to INT,FOREIGN KEY(Assigned_To) REFERENCES Users(User_Id),FOREIGN KEY(Asset_Id) REFERENCES Asset(Asset_Id),Assigned_from timestamp without time zone NULL,Updated_on timestamp without time zone  NULL,Updated_by varchar not null,Remarks varchar(300)NOT NULL,Duration varchar(30) NULL,Asset_type varchar(50) NOT NULL);
